import React, {useState} from 'react';
import Tdatas from './Tdatas.json';

const Tdata = () => {

const [nData,setnData] = useState(Tdatas);
return(
<>
<ul>
{

nData.map(items = 
<li key = {items.id}>
 {items.name}   
</li>)
}


</ul>
</>
)

}
export default Tdata
